import './App.scss';
import Header from './components/Header/Header.jsx';

const App = () => {
	return (
		<Router>
			<div className='app'>
				<Header />
			</div>
			<Switch>
				<Route path='/login'></Route>
				<Route path='/signup'></Route>
				<Route path='/'></Route>
			</Switch>
		</Router>
	);
};

export default App;
